            <Box
              onClick={() => navigate("/changelocation")}
              sx={{
                height: "24px",
                "&:hover": {
                  cursor: "pointer",
                },
              }}
            >
              <EditIcon />
            </Box>
          </Box>
          <Typography
            sx={{ marginTop: "11px", fontWeight: 500, fontSize: "14px" }}
          >
            Bayu
          </Typography>
          <Typography
            sx={{
              marginTop: "6px",
              fontSize: "12px",
              fontWeight: 400,
              color: "#333333",
            }}
          >
            +6281903810
          </Typography>
          <Typography
            sx={{
              marginTop: "5px",
              fontWeight: 400,
              fontSize: "12px",
              color: "#333333",
            }}
          >
            Jl. Pulo Mas Barat XI No.19, RT.3/RW.10, Kayu Putih, Kec. Pulo
            Gadung, Kota Jakarta Timur, Daerah Khusus Ibukota Jakarta 13210
          </Typography>
        </Box>
      </Box>

      {Object.keys(APIAddress).map((i) => (
        <>
          <Box
            sx={{
              border: "1px solid #F5F5F5",
              borderRadius: "8px",
              width: PADDING,
              height: "163px",
              overflow: "hidden",
              marginTop: "21px",
              display: "flex",
            }}
          >
            {mainLoc[3] ? (
              <Box
                sx={{
                  height: "100%",
                  width: "12px",
                  background: THEME.GREEN_PRIMARY,
                }}
              />
            ) : (
              ""
