                      "&:hover": {
                        cursor: "pointer",
                      },
                    }}
                    onClick={handleBtn(3)}
                  >
                    Jadikan Alamat Utama
                  </Box>
                )}

                <Box
                  onClick={() => navigate("/changelocation")}
                  sx={{
                    height: "24px",
                    "&:hover": {
                      cursor: "pointer",
                    },
                  }}
                >
                  <EditIcon />
                </Box>
              </Box>
              <Typography
                sx={{ marginTop: "11px", fontWeight: 500, fontSize: "14px" }}
              >
                Bayu
              </Typography>
              <Typography
                sx={{
                  marginTop: "6px",
